import React from "react"
import ThemeContext from "./ThemeContext"

export default function Header(props){
    return( 
        <div className={this.context.theme + "-theme"}>
            WELCOME TO THE DARK SIDE
        </div>
    )
}

Header.contextType = ThemeContext;
